import React, { useEffect, useRef, useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import { useDispatch, useSelector } from 'react-redux';
import { setProfile, setBalance, setServices, setBanner, setError } from '../redux/actions';
import './styles/HomePage.css';
import ProfilePhoto from '../assets/ProfilePhoto.png';
import PBBIcon from '../assets/PBB.png';
import ListrikIcon from '../assets/Listrik.png';
import PulsaIcon from '../assets/Pulsa.png';
import PDAMIcon from '../assets/PDAM.png';
import PGNIcon from '../assets/PGN.png';
import TelevisiIcon from '../assets/Televisi.png';
import MusikIcon from '../assets/Musik.png';
import VoucherGameIcon from '../assets/Game.png';
import VoucherMakananIcon from '../assets/VoucherMakanan.png';
import KurbanIcon from '../assets/Kurban.png';
import ZakatIcon from '../assets/Zakat.png';
import PaketDataIcon from '../assets/PaketData.png';
import Logo from '../assets/Logo.png';
// Tidak perlu import Banner1, Banner2, dll. karena kita ambil dari API

const HomePage = () => {
  const servicesListRef = useRef(null); 
  const [currentBanner, setCurrentBanner] = useState(0);

  const dispatch = useDispatch();
  const navigate = useNavigate();

  const profile = useSelector((state) => state.profile);
  const balance = useSelector((state) => state.balance);
  const services = useSelector((state) => state.services);
  const banner = useSelector((state) => state.banner);
  const error = useSelector((state) => state.error);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const token = localStorage.getItem('token');
        if (!token) {
          throw new Error('Token tidak ditemukan. Silakan login kembali.');
        }

        // Fetch data (profile, balance, services) with error handling (same as before)

        // Fetch Banner (Public API - no token needed)
        const bannerResponse = await fetch('https://take-home-test-api.nutech-integrasi.com/banner', {
          headers: { 'Accept': 'application/json' },
        });

        if (!bannerResponse.ok) {
          const errorData = await bannerResponse.json();
          throw new Error(`Terjadi kesalahan saat mengambil banner: ${errorData.message || 'Unknown error'}`);
        }

        const bannerData = await bannerResponse.json();
        dispatch(setBanner(bannerData.data));
      } catch (error) {
        dispatch(setError(error.message)); // Simpan pesan error yang lebih informatif
        console.error('Error fetching data:', error);
      }
    };

    fetchData();
  }, [dispatch]);


  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentBanner((prevIndex) => (prevIndex + 1) % banner.length);
    }, 5000); // Ubah waktu sesuai kebutuhan
    return () => clearInterval(interval);
  }, [banner.length]);

  if (error) {
    return <div className="error-message">{error}</div>;
  }

  if (!profile || !balance || !services || !banner) {
    return <div>Loading...</div>;
  }

  const servicesList = [
    // ... (daftar layanan seperti sebelumnya)
  ];

  return (
    <div className="homepage">
      <header>
        <h1 className="logo">
          <img src={Logo} alt="Logo" className="logo-img" />
          <Link to="/" style={{ textDecoration: 'none', color: 'black' }}>
            SIMS PPOB
          </Link>
        </h1>
        {/* ... (navigasi seperti sebelumnya) */}
      </header>

      <main>
        {/* ... (user-info dan saldo seperti sebelumnya) */}

        <section className="services-section">
          <div className="services-list" ref={servicesListRef}>
            {servicesList.map((service, index) => (
              <div key={index} className="service-item">
                <img src={service.icon} alt={service.name} />
                <p>{service.name}</p>
              </div>
            ))}
          </div>
        </section>

        {/* Promo Menarik Section */}
        <section className="promo-menarik">
          <h2>Temukan promo menarik</h2>
          <div className="promo-grid">
            {banner.map((promo, index) => (
              <div key={index} className="promo-item">
                <img src={promo.imageUrl} alt={promo.title} />
                <p>{promo.title}</p> {/* Menampilkan judul promo */}
                <p className="promo-desc">{promo.description}</p> {/* Menampilkan deskripsi promo */}
              </div>
            ))}
          </div>
        </section>
      </main>

      <footer>
        {/* Footer content here */}
      </footer>
    </div>
  );
};

export default HomePage;
